import React from "react";
import { Input } from 'antd';
import 'antd/dist/antd.css';


class Login extends React.Component {
  render() {
    return (
      <>
        <p>Login</p>
        <Input placeholder="Username"/>
        <Input.Password placeholder="Password" />
      </>
    );
  }
}

export default Login;
